import React from 'react';
import styles from './Card.module.css'

export default function Card(props) {
  // ac치 va tu c칩digo
const {max, min, name, img, onClose,primary} = props;

  return <div className={`${styles.card} ${props.primary ? styles.primary : ''}`}>
  <button onClick ={onClose}>x</button>

    <span>{name}</span>  
    <img src={`http://openweathermap.org/img/wn/${img}@2x.png`} alt=""/>
  <div className={styles.temps} >
     <Temp label="Min" temp={min}/>
     <Temp label="Max" temp={max}/>
    </div>
 
</div>

};
function Temp({label, temp}){
  return (
    <div className={styles.temp}>
      <span>{label} </span>
      <span>{temp} </span>
    </div>
  )
}
router.delete('/', async (req, res, next) => {
  const {id} = req.body;
  try {
      await Pokemons.destroy({
          where: {
              id: id
          }
      })
      res.send(`Pokemon with id: ${id} has been deleted successfully!`)
  } catch (error) {
      next(error)        
  }
})
